import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Data = () => {
  const [data, setData] = useState([]);
  const [wef_date, setwef_date] = useState('');
  const [pf_per, setpf_per] = useState('');
  const [epf_Per, setepf_per] = useState('');
  const [fpf_Per, setfpf_per] = useState('');
  const [ca, setca] = useState('');
  const [editingItem, setEditingItem] = useState(null);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/data'); // Replace with your Node.js server URL
      setData(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  const handleInsert = async () => {
    try {
      await axios.post('http://localhost:3001/api/data', { wef_date: wefDate, pf_per: pfPer, epf_per: epfPer, fpf_per: fpfPer, ca: ca }); // Replace with your Node.js server URL
      fetchData();
      setwef_date('');
      setpf_per('');
      setepf_per('');
      setfpf_per('');
      setca('');
    } catch (error) {
      console.error(error);
    }
  };

  const handleUpdate = async () => {
    if (!editingItem) return;

    try {
      await axios.put(`http://localhost:3001/api/data/${editingItem.ID}`, { wef_date: wefDate, pf_per: pfPer, epf_per: epfPer, fpf_per: fpfPer, ca: ca }); // Replace with your Node.js server URL
      fetchData();
      setwef_date('');
      setpf_per('');
      setepf_per('');
      setfpf_per('');
      setca('');
      setEditingItem(null);
    } catch (error) {
      console.error(error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:3001/api/data/${id}`); // Replace with your Node.js server URL
      fetchData();
    } catch (error) {
      console.error(error);
    }
  };

  const handleEdit = (item) => {
    setEditingItem(item);
    setwef_date(item.wef_date);
    setpf_per(item.pf_per);
    setepf_per(item.epf_Per);
    setfpf_per(item.fpf_Per);
    setca(item.ca);
  };

  return (
    <div>
      <h1>React CRUD</h1>
      <div>
        <label>WEF Date:</label>
        <input type="text" value={wef_date} onChange={(e) => setwef_date(e.target.value)} />
      </div>
      <div>
        <label>PF Percentage:</label>
        <input type="text" value={pf_per} onChange={(e) => setpf_per(e.target.value)} />
      </div>
      <div>
        <label>EPF Percentage:</label>
        <input type="text" value={epf_per} onChange={(e) => sete(e.target.value)} />
      </div>
      <div>
        <label>FPF Percentage:</label>
        <input type="text" value={fpf_per} onChange={(e) => setFpfPer(e.target.value)} />
      </div>
      <div>
        <label>CA:</label>
        <input type="text" value={ca} onChange={(e) => setCa(e.target.value)} />
      </div>
      <button onClick={editingItem ? handleUpdate : handleInsert}>
        {editingItem ? 'Update' : 'Insert'}
      </button>
      <ul>
        {data.map((item) => (
          <li key={item.ID}>
            {item.wef_date} - {item.pf_per} - {item.epf_Per} - {item.fpf_per} - {item.ca}
            <button onClick={() => handleEdit(item)}>Edit</button>
            <button onClick={() => handleDelete(item.ID)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Data;
